import React from "react";
import "./styles/landing.css"
import { motion } from "framer-motion";

const Section = ({id, title, content, buttonMsg}) => {
    return (
        <div className='container'>
            <section id={id}>
                <h2>{title}</h2>
                <p>{content}</p>
                <button><a href="console.onereturn.com/signin">{buttonMsg}</a></button>
            </section>
        </div>
    );
};

const Landing = () => {

    return (
        <div className="container">
            <Section id="home" title="Home" content="HOME"/>
            <Section id="for-business" title="For Businesses" content="Try OneReturn for business" button/>
            <Section id="pricing" title="Pricing" content="PRICING"/>
        </div>



    )
}

export default Landing;
